      "name": "- Đơn đề nghị hỗ trợ chi phí khám, chữa bệnh cho trẻ em (mẫu số 04); - Bản sao Sổ hộ khẩu của gia đình; - Bản sao giấy ra viện;  - Bản gốc biên lai thu viện phí của cơ sở y tế công lập theo quy định của Bộ Tài chính; bảng kê thanh toán của cơ sở y tế công lập theo mẫu quy định của Bảo hiểm xã hội Việt Nam; - Bản sao các giấy tờ sau:   + Giấy chứng nhận hộ nghèo hoặc hộ cận nghèo (nếu đối tượng thuộc diện hộ nghèo, hộ cận nghèo);  +Giấy kết luận của cơ sở y tế có thẩm quyền đối với trẻ nhiễm HIV/AIDS;  + Giấy kết luận của cơ sở y tế có thẩm quyền về “Tính tự kỷ của trẻ em” đối với trẻ em tự kỷ đang theo học tại các cơ sở giáo dục; + Kết luận của cơ sở y tế có thẩm quyền về tai nạn thương tích hoặc bị bạo lực đối với trẻ em là nạn nhân của tai nạn thương tích hoặc bị bạo lực; xác nhận của cơ quan Công an có thẩm quyền hoặc UBND cấp xã về nguyên nhân tai nạn thương tích hoặc bị bạo lực; + Kết luận của cơ sở y tế hoặc cơ quan có thẩm quyền xác nhận đối với trẻ em bị câm, điếc.  + Giấy xác nhận hoặc kết luận của cơ quan Công an đối với trẻ em bị xâm hại tình dục; + Quyết định trợ cấp hoặc hỗ trợ của Chủ tịch Ủy ban nhân dân cấp huyện (nếu đối tượng thuộc diện hưởng chính sách Bảo trợ xã hội hoặc đối tượng là trẻ em mồ côi cha hoặc mẹ, không có nguồn nuôi dưỡng); Quyết định trợ cấp của Giám đốc Sở Lao động - Thương binh và Xã hội (nếu đối tượng thuộc diện hưởng chính sách con của người có công với cách mạng) hoặc giấy xác nhận của Ủy ban nhân dân cấp xã đối với con của người có công với cách mạng; nếu trẻ em sống tại cơ sở bảo trợ xã hội thì có xác nhận của cơ sở bảo trợ xã hội. - Vé xe công cộng thông thường theo quy định của Nhà nước; trường hợp đối tượng không có vé xe thì kê khai quãng đường đi (mẫu số 07A).- Đơn đề nghị hỗ trợ chi phí khám, chữa bệnh cho trẻ em (mẫu số 04); - Bản sao Sổ hộ khẩu của gia đình; - Bản sao giấy ra viện;  - Bản gốc biên lai thu viện phí của cơ sở y tế công lập theo quy định của Bộ Tài chính; bảng kê thanh toán của cơ sở y tế công lập theo",
