      "title": "G18.YCDK.00109",
      "name": "Cơ sở vật chất: Trường hợp thực hiện thủ thuật, bao gồm cả kỹ thuật cấy ghép răng (implant), châm cứu, xoa bóp day ấn huyệt thì phải có phòng hoặc khu vực riêng dành cho việc thực hiện thủ thuật. Phòng hoặc khu vực thực hiện thủ thuật phải có đủ diện tích để thực hiện kỹ thuật chuyên môn; Trường hợp phòng khám chuyên khoa thực hiện cả hai kỹ thuật nội soi tiêu hóa trên và nội soi tiêu hóa dưới thì phải có 02 phòng riêng biệt;",
