      "id": "qd_ycdk_384",
      "title": "G16.YCDK.00070",
      "name": "Trang thiết bị tập luyện  Khung cầu môn được làm bằng một trong các chất liệu sau: Kim loại, gỗ hoặc chất dẻo tổng hợp, bảo đảm kích thước theo quy định của Luật thi đấu bóng đá. Cột cầu môn tròn, không gây nguy hiểm cho người tập luyện, thi đấu bóng đá.  Bóng có kích thước và trọng lượng theo quy định của Luật thi đấu bóng đá.  Trang thiết bị thi đấu môn Bóng đá phải bảo đảm theo quy định của Luật thi đấu Bóng đá.",
