      "title": "G16.YCDK.00073",
      "name": "Tường leo. Tường leo đối với leo dẫn đường và leo với dây neo sẵn: - Bảo đảm chiều cao ít nhất 4,5m khi tổ chức tập luyện; - Bảo đảm chiều cao ít nhất 8m khi tổ chức giải thi đấu cấp tỉnh, thành phố, câu lạc bộ; - Bảo đảm chiều cao ít nhất 12m khi tổ chức giải thi đấu quốc gia. Tường leo đối với leo khối đá: - Chiều cao không vượt quá 4,5m và có đệm bảo hộ dưới đất; - Đối với tường leo độ cao từ 3m trở xuống: Đệm bảo hộ dưới đất dày ít nhất 12cm và có tính đàn hồi; - Đối với tường leo độ cao từ 3m đến 4,5m: Đệm bảo hộ dưới đất dày ít nhất 20cm và có tính đàn hồi. Mấu bám trên tường leo bảo đảm không bị lỏng hoặc xoay vặn và theo tiêu chuẩn của Liên đoàn Leo núi quốc tế. Khung kết cấu tường leo bảo đảm chịu được tải trọng của toàn bộ tường leo và lực tác động của người leo. Có bảng nội quy quy định về giờ tập luyện, trang phục tập luyện và biện pháp bảo đảm an toàn khi tập luyện và thi đấu. Có khu vực vệ sinh, thay đồ, nơi để đồ dùng cá nhân cho người tập",
