      "title": "G12.YCDK.00007",
      "name": "1. Văn bản đề nghị công nhận theo Mẫu số 01 tại Phụ lục ban hành kèm theo Nghị định này: 01 bản chính.  2. Giấy chứng nhận đăng ký doanh nghiệp hoặc Giấy chứng nhận đầu tư: 01 bản sao.  3. Sơ đồ thiết kế khu vực địa điểm tập kết, kiểm tra, giám sát hàng hóa xuất khẩu, nhập khẩu tập trung; địa điểm phát chuyển nhanh, hàng bưu chính thể hiện rõ đường ranh giới ngăn cách với bên ngoài, vị trí các kho hàng, nơi tập kết hàng xuất khẩu, nơi tập kết hàng nhập khẩu, nơi tập kết phương tiện vận tải, nơi kiểm tra thực tế, bảo vệ, văn phòng kho và nơi làm việc của hải quan: 01 bản sao.  4. Tài liệu mô tả chương trình phần mềm quản lý hàng hóa đưa vào đưa ra địa điểm: 01 bản chính.  5. Giấy tờ chứng minh quyền sử dụng địa điểm: 01 bản sao.  6. Giấy chứng nhận đủ điều kiện phòng cháy và chữa cháy do cơ quan công an cấp: 01 bản sao.  7. Quy chế hoạt động: 01 bản chính.  8. Văn bản quy hoạch khu vực sân bay quốc tế do cơ quan có thẩm quyền phê duyệt đối với trường hợp công nhận địa điểm tập kết, kiểm tra, giám sát tập trung đối với hàng chuyển phát nhanh: 01 bản sao.  9. Giấy phép bưu chính hoặc thông báo hoạt động bưu chính do cơ quan có thẩm quyền cấp theo quy định của pháp luật về bưu chính đối với trường hợp công nhận địa điểm tập kết, kiểm tra, giám sát tập trung đối với hàng bưu chính: 01 bản sao.",
