      "id": "qd_ycdk_85",
      "title": "G18.YCDK.00054",
      "name": "6. Điều 8 được sửa đổi, bổ sung như sau: “Điều 8. Cơ sở đào tạo, cập nhật kiến thức chuyên môn về dược 1. Cơ sở đào tạo, cập nhật kiến thức chuyên môn về dược phải là một trong các tổ chức sau: Cơ sở giáo dục nghề nghiệp có đào tạo chuyên ngành y, dược; cơ sở giáo dục có đào tạo mã ngành thuộc khối ngành khoa học sức khỏe; viện nghiên cứu có chức năng đào tạo chuyên ngành y, dược; cơ sở có chức năng đào tạo nhân lực y tế; các hội nghề nghiệp về dược; 2. Cơ sở đào tạo cập nhật kiến thức chuyên môn về dược phải xây dựng chương trình đào tạo bao gồm các nội dung chính sau đây:  a) Nội dung đào tạo bao gồm:  - Kiến thức chuyên ngành; - Pháp luật và quản lý chuyên môn về dược;  b) Thời gian đào tạo, cập nhật kiến thức chuyên môn về dược: tối thiểu 08 giờ.”",
