      "name": "Địa điểm thi đấu môn Thể dục thể hình và Fitness diễn ra trong nhà, trong sân tập hoặc ngoài trời.  Sân khấu: Kích thước sân khấu 12m x 12m và có chiều cao 0,8m. Mặt sân khấu phải được trải thảm mềm. Thảm mầu xanh nước biển hoặc mầu xanh ngọc.  Phông: Phía sau sân khấu thi đấu phải căng một tấm phông với một trong những mầu sắc sau đây: Xanh đen, nâu sẫm, xanh lục sẫm, tím sẫm.  Bục thi đấu môn Thể dục thể hình đặt ở vị trí trung tâm sân khấu. Kích thước bục dài 06m, rộng 02m và cao 0,3m, có thảm bao xung quanh mầu lục nhạt hoặc mầu lam nhạt.  Ánh sáng từ 1500 lux trở lên. Đối với môn Fitness phải sáng đều khắp sân khấu; đối với môn Thể dục thể hình ánh sáng tập trung chiếu rọi khu vực bục thi đấu.  Hệ thống âm thanh trong tình trạng hoạt động tốt.  Khu vực khởi động phải gần địa điểm thi đấu. Trang thiết bị khởi động cần có gồm: Cần tạ, bánh tạ, tạ tay, dây chun, dây lò so, ghế tập.",
