      "title": "G03.YCDK.00063",
      "name": ") Phạm vi liên kết đào tạo: - Cơ sở giáo dục đại học quy định tại điểm a khoản 1 Điều 15 Nghị định số 86/2018/NĐ-CP chỉ được liên kết đào tạo trong phạm vi ngành và trình độ đào tạo đã được cơ quan có thẩm quyền của Việt Nam cho phép thực hiện. - Cơ sở giáo dục đại học quy định tại điểm b khoản 1 Điều 15 Nghị định số 86/2018/NĐ-CP chỉ được liên kết đào tạo trong phạm vi ngành và trình độ đào tạo được phép thực hiện và được cơ quan có thẩm quyền của Việt Nam công nhận. b) Quy mô đào tạo của liên kết được xác định căn cứ vào các điều kiện bảo đảm chất lượng về cơ sở vật chất, thiết bị, phòng thí nghiệm, thư viện, đội ngũ giảng viên và cán bộ quản lý. Các điều kiện này không được trùng với các điều kiện đã được sử dụng để tính toán tổng chỉ tiêu tuyển sinh của cơ sở giáo dục. Trường hợp có chung các điều kiện bảo đảm chất lượng thì quy mô đào tạo của các chương trình liên kết đào tạo phải được tính trong tổng quy mô tuyển sinh hàng năm của cơ sở giáo dục. Cơ sở giáo dục đại học Việt Nam và cơ sở giáo dục đại học nước ngoài đề xuất quy mô đào tạo trong hồ sơ đề nghị phê duyệt liên kết đào tạo, trình các cấp có thẩm quyền quy định tại Điều 22 Nghị định số 86/2018/NĐ-CP phê duyệt.",
