      "name": "Thành viên Ban kiểm soát:+ Không thuộc đối tượng quy định tại khoản 1 Điều 33 Luật các tổ chức tín dụng (đã được sửa đổi, bổ sung); + Có bằng đại học trở lên về một trong các chuyên ngành kinh tế, tài chính, kế toán, kiểm toán, ngân hàng, quản trị kinh doanh, luật và có ít nhất 01 (một) năm kinh nghiệm làm việc trong lĩnh vực có liên quan hoặc có bằng tốt nghiệp từ trung cấp trở lên về một trong các chuyên ngành kinh tế, tài chính, kế toán, kiểm toán, ngân hàng, luật và có ít nhất 03 (ba) năm kinh nghiệm làm việc ở vị trí liên quan đến lĩnh vực tài chính vi mô; + Không bị xử phạt vi phạm hành chính trong lĩnh vực tiền tệ và ngân hàng ở khung phạt tiền cao nhất đối với hành vi vi phạm quy định về giấy phép, quản trị, điều hành, cổ phần, cổ phiếu, góp vốn, mua cổ phần, cấp tín dụng, mua trái phiếu doanh nghiệp, tỷ lệ bảo đảm an toàn theo quy định của pháp luật về xử lý vi phạm hành chính trong lĩnh vực tiền tệ và ngân hàng trong thời gian 24 (hai mươi tư) tháng liền kề trước thời điểm được bầu; + Thành viên Ban kiểm soát chuyên trách phải cư trú tại Việt Nam trong thời gian đương nhiệm.",
