      "name": "Người chịu trách nhiệm chuyên môn kỹ thuật của phòng xét nghiệm phải đáp ứng các điều kiện như sau:  - Là bác sỹ hoặc kỹ thuật viên chuyên ngành xét nghiệm, trình độ đại học trở lên có chứng chỉ hành nghề chuyên khoa xét nghiệm; hoặc cử nhân hóa học, sinh học, dược sĩ trình độ đại học đối với người đã được tuyển dụng làm chuyên ngành xét nghiệm trước ngày Nghị định này có hiệu lực và được cấp chứng chỉ hành nghề chuyên khoa xét nghiệm với chức danh là kỹ thuật viên.  - Có thời gian làm chuyên khoa xét nghiệm phù hợp ít nhất là 54 tháng hoặc thời gian hành nghề xét nghiệm ít nhất là 36 tháng, bao gồm cả thời gian học sau đại học về chuyên khoa xét nghiệm kể từ ngày bắt đầu thực hiện công việc xét nghiệm (xác định từ thời điểm ký kết hợp đồng lao động hoặc có quyết định tuyển dụng) đến ngày được phân công, bổ nhiệm làm người chịu trách nhiệm chuyên môn kỹ thuật của phòng xét nghiệm.",
