      "title": "G19.YCDK.00084",
      "name": "Thành viên sáng lập của tổ chức tài chính vi mô là công ty trách nhiệm hữu hạn hai thành viên trở lên: + Có ít nhất một thành viên sáng lập là tổ chức chính trị hoặc tổ chức chính trị - xã hội; + Có ít nhất một thành viên sáng lập là tổ chức đã hoặc đang trực tiếp tham gia quản lý hoặc điều hành chương trình, dự án tài chính vi mô hoạt động an toàn, bền vững trong ít nhất 03 (ba) năm liên tiếp trước thời điểm nộp đơn đề nghị cấp Giấy phép;",
