      "name": "Thành viên sáng lập là cá nhân:+ Có quốc tịch Việt Nam, có năng lực hành vi dân sự đầy đủ theo quy định của pháp luật;  + Không thuộc những đối tượng bị cấm thành lập và quản lý doanh nghiệp theo quy định của Luật Doanh nghiệp; không bị xử phạt vi phạm hành chính trong lĩnh vực tiền tệ và ngân hàng ở khung phạt tiền cao nhất đối với hành vi vi phạm quy định về giấy phép, quản trị, điều hành, cổ phần, cổ phiếu, góp vốn, mua cổ phần, cấp tín dụng, mua trái phiếu doanh nghiệp, tỷ lệ bảo đảm an toàn theo quy định của pháp luật về xử lý vi phạm hành chính trong lĩnh vực tiền tệ và ngân hàng trong thời gian 24 (hai mươi tư) tháng liền kề trước thời điểm nộp đơn đề nghị cấp Giấy phép;  + Không phải là cổ đông sáng lập, thành viên sáng lập của tổ chức tín dụng khác tại Việt Nam;  + Có khả năng về tài chính để góp vốn thành lập tổ chức tài chính vi mô và cam kết không dùng vốn ủy thác, vốn huy động, vốn vay của các tổ chức, cá nhân khác để góp vốn; cam kết hỗ trợ tổ chức tài chính vi mô về tài chính để giải quyết khó khăn trong trường hợp gặp khó khăn về vốn hoặc khả năng thanh khoản;",
