      "id": "qd_ycdk_1073",
      "title": "G18.YCDK.00258",
      "name": "Bác sĩ chuyên khoa bệnh nghề nghiệp có chứng chỉ hành nghề hoặc bác sỹ đa khoa có chứng chỉ hành nghề và chứng chỉ đào tạo về bệnh  nghề nghiệp",
